import React from 'react';
import { Link } from 'react-router-dom';

// Navbar component with navigation links
const Navbar = () => (
  <nav>
    <Link to="/">Home</Link>
    <Link to="/search">Bag</Link>
    <Link to="/ourteam">Our Team</Link>
    {/* Add more links as needed */}
  </nav>
);

// Main content of the HomePage
const HomePageContent = () => (
  <main>
    <h1>Welcome to Marineekko</h1>
    {/* Add more content here */}
  </main>
);

// Footer component
const Footer = () => (
  <footer>
    <p>Â© 2024 Marineekko Co., Ltd.</p>
  </footer>
);

// HomePage component assembling the Navbar, HomePageContent, and Footer
const HomePage = () => {
  return (
    <div>
      <Navbar />
      <HomePageContent />
      <Footer />
    </div>
  );
}

export default HomePage;
